
public class ForFlowEx3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.print(1);
		System.out.print(2);
		System.out.print(3);
		System.out.print(4);
		System.out.print(5);
		
		for (int i = 2; i <= 5; i++) {
			System.out.print(i);
		}
		
		
	}

}
